import Link from "next/link";

const Index = () => {
  return (
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/about">
          <a>about</a>
        </Link>
      </li>
    </ul>
  );
};

export default Index;
